svg.script:
var r_angle = -150;
var y_angle = -150;
var arrow_speed = 0;
$("#queue").setAttribute("style", "--arrow-speed:" + (1 - arrow_speed / 10) + "s");

function $(sel) {
  return document.querySelector(sel);
}

$("#rb_left").onclick = function() {
  if(r_angle > -150) {
    r_angle -= 5;
    $("#red_arrow").setAttribute("transform", "rotate(" + r_angle + " 641.3 424.7)");
  }
}

$("#rb_right").onclick = function() {
  if(r_angle < 150) {
    r_angle += 5;
    $("#red_arrow").setAttribute("transform", "rotate(" + r_angle + " 641.3 424.7)");
  }
}

$("#yb_left").onclick = function() {
  if(y_angle > -150) {
    y_angle -= 5;
    $("#yellow_arrow").setAttribute("transform", "rotate(" + y_angle + " 1223.1 424.7)");
  }
}

$("#yb_right").onclick = function() {
  if(y_angle < 150) {
    y_angle += 5;
    $("#yellow_arrow").setAttribute("transform", "rotate(" + y_angle + " 1223.1 424.7)");
  }
}
